(7, STRINGDECODE('\u0418\u043d\u0442\u0435\u043b\u043b\u0435\u043a\u0442\u0443\u0430\u043b\u044c\u043d\u0430\u044f \u0438\u0433\u0440\u0430'), STRINGDECODE('22 \u0430\u043f\u0440\u0435\u043b\u044f 2017 \u0433\u043e\u0434\u0430 \u0432\u043e\u043b\u043e\u043d\u0442\u0451\u0440\u044b \u041c\u0411\u041e \"\u0410\u049b\u043d\u0438\u0435\u0442\" \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u043e \u0441 \u0430\u043a\u0442\u0438\u0432\u0438\u0441\u0442\u0430\u043c\u0438 \u0426\u0435\u043d\u0442\u0440\u0430 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043a\u0442\u043e\u0432 \u0410\u0421\u041e \u041a\u0430\u0440\u0413\u0422\u0423 \"\u0416\u0430\u0441 \u041e\u0440\u0434\u0430\" \u043f\u0440\u043e\u0432\u0435\u043b\u0438 \u0434\u043b\u044f \u0434\u0435\u0442\u0435\u0439 \u0438\u0437 \u0434\u0435\u0442\u0441\u043a\u0438\u0445 \u0434\u043e\u043c\u043e\u0432 \u0438\u043d\u0442\u0435\u043b\u043b\u0435\u043a\u0442\u0443\u0430\u043b\u044c\u043d\u0443\u044e \u0438\u0433\u0440\u0443 \"\u041f\u043e\u043f\u0440\u043e\u0431\u0443\u0439 \u0443\u0433\u0430\u0434\u0430\u0439!\".\ud83d\ude47\ud83c\udffb\n\u0423\u0447\u0430\u0441\u0442\u043d\u0438\u043a\u0430\u043c\u0438 \u0434\u0430\u043d\u043d\u043e\u0439 \u0438\u0433\u0440\u044b \u0431\u044b\u043b\u0438 \u043a\u043e\u043c\u0430\u043d\u0434\u0430 \"\u0423\u043c\u043d\u0438\u043a\u0438\" \u0438\u0437 \u0434\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0434\u043e\u043c\u0430 \"\u0422\u0430\u04a3\u0448\u043e\u043b\u043f\u0430\u043d\" \u0438 \u043a\u043e\u043c\u0430\u043d\u0434\u0430 \"\u0411\u0430\u0440\u044b\u0441\" \u0438\u0437 \u0434\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0434\u043e\u043c\u0430 \"\u049a\u04b1\u043b\u044b\u043d\u0448\u0430\u049b\".\ud83c\udfe9\n\u0418\u0433\u0440\u0430 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0430 \u0438\u0437 \u0442\u0440\u0451x \u044d\u0442\u0430\u043f\u043e\u0432, \u0433\u0434\u0435 \u043a\u0430\u0436\u0434\u043e\u0439 \u043